import Card from "../../UI/Card/Card";

const MealItem = (props) => {
  return (
    <div>
      <ul>
        {props.meals.map((meal) => (
          <li>
            {meal.name} {meal.description}
            {meal.price}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MealItem;
